    {
        [TestMethod()]
        [DataRow(3, 3, 0, 0)]
        [DataRow(5, 5, 1, 1)]
        public void GetReport_returns_shortest_path_from_start_to_dest(int nRows, int nCols, int row, int startCol)
        {
            int destCol = nCols - 2;

            // Set up component test
            Grid grid = new Grid(nRows, nCols);
            grid.SetStart(row, startCol);
            grid.SetDestination(row, destCol);

            List<int> expected = new List<int>();
            for (int iCol = startCol; iCol <= destCol; iCol++)
            {
                expected.Add(grid.Cells[row, iCol].Id);
            }

            // Act
            AStarGridAnalysis aStar = new AStarGridAnalysis(grid);

            // Assert
            List<int> actual = aStar.Report.ShortestPathToDest;
            CollectionAssert.AreEqual(actual, expected);
            Debug.WriteLine(aStar.Report);
        }

